import React from "react";
import logo from "./logo.svg";
import styled from "styled-components";
import "./App.css";

const TitlePanel = styled.div`
  width: 80vw;
  margin: 30px auto;
  border-radius: 4px;
  border: 1px solid black;
  padding: 1rem;
  background-color: rgba(0, 0, 0, 0.76));
`;

function App() {
  return (
    <div className="App">
      <TitlePanel></TitlePanel>
    </div>
  );
}

export default App;
